precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec4 v_color;
in vec2 v_uv0;
uniform sampler2D texture;
uniform Light {
  vec4 lightColor;
  float lightAngle;
  float lightWidth;
  float moveSpeed;
  float moveWidth;
  float enableRender;
  float renderTime;
  float enableGradient;
};
vec4 addLightColor(vec4 textureColor, vec4 lightColor, vec2 lightCenterPoint, float lightAngle, float lightWidth) {
  if (lightWidth <= 0.0) {
    return textureColor;
  }
  float angleInRadians = radians(lightAngle);
  float dis = 0.0;
  if (mod(lightAngle, 180.0) != 0.0) {
    float lightOffsetX = lightCenterPoint.x - ((1.0 - lightCenterPoint.y) / tan(angleInRadians));
    float dx = lightOffsetX + (1.0 - v_uv0.y) / tan(angleInRadians);
    float offsetDis = abs(v_uv0.x - dx);
    dis = sin(angleInRadians) * offsetDis;
  } else {
    dis = abs(v_uv0.y - lightCenterPoint.y);
  }
  float a = 1.0 ;
  a *= step(dis, lightWidth * 0.5);
  if (bool(enableGradient)) {
    a *= 1.0 - dis / (lightWidth * 0.5);
  }
  vec4 finalLightColor = lightColor * a;
  return textureColor * textureColor.a + finalLightColor;
}
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  o *= texture(texture, v_uv0);
  o *= v_color;
  gl_FragColor = o;
  if(bool(enableRender)){
    vec2 lightCenterPoint;
    lightCenterPoint.x = mod(renderTime * moveSpeed, moveWidth+lightWidth)-lightWidth*0.5;
    lightCenterPoint.y = moveWidth - lightCenterPoint.x;
    gl_FragColor = addLightColor(gl_FragColor, lightColor, lightCenterPoint, lightAngle, lightWidth);
  }
}

